window.bookSummaryJSON = "<p><i>Star Kingdom Omnibus II</i> contains books 4 &amp; 5 of the Star Kingdom series.</p> <p><b><i>Crossfire</i></b><b>, book 4:</b></p> <p>For the first time in his life, roboticist Casmir Dabrowski is headed to another star system as an advisor for the Kingdom space fleet. He’s being given a chance to prove himself to King Jager by helping find the ancient artifact he inadvertently lost. It’s best not to think about what might happen if he fails....</p> <p>But with technologically advanced astroshamans after the artifact, not to mention the deadly mercenary captain Tenebris Rache, it’s not long before the mission collides with disaster.&nbsp;</p> <p>Soon, Casmir and his friends are caught between warring factions, and he must choose between what the king would want and what he knows is right.&nbsp;</p> <p><b><i>Gate Quest</i></b><b>, book 5: </b></p> <p>Roboticist extraordinaire Casmir Dabrowski has a new nemesis: astroshaman leader Kyla Moonrazor.&nbsp;</p> <p>She’s stolen the ancient wormhole gate the king ordered Casmir to retrieve, and she’s entrenched in an underwater base on a forsaken moon. Moonrazor is more educated and more experienced than Casmir, and she has legions of killer robots and cyborg defenders on her side. Casmir has his friends and...a submarine named the <i>Waddler</i>.&nbsp;</p> <p>As if his task wasn’t daunting enough, his old competitor, mercenary Captain Tenebris Rache, is on the same quest, and he’ll do anything to keep the Kingdom from getting that gate.&nbsp;</p> <p>If Casmir can’t find a way to defeat them, the king will never let him return to his home, his family, and the career he loves.</p>"; 
